import React, { Component } from 'react'
import './styles.css'
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const photos = [
    {
        name : "Photo 1",
        id : 1,
        url : "https://guide.servify.in/wp-content/uploads/2018/03/Get-Notifications-from-Phone-to-Your-Laptop.jpg",
    },
    {
        name : "Photo 2",
        id:2,
        url : "https://cdn5.vectorstock.com/i/1000x1000/18/19/mobile-phone-and-tablet-pc-connected-to-laptop-vector-21451819.jpg",
    },
    {
        name : "Photo 3",
        id : 3,
        url : "https://www.lifesavvy.com/thumbcache/0/0/5bb010ab66a1f46bfb8f6279668bc52e/p/uploads/2020/01/885f24d8.jpg",
    }
]

class Home extends Component {


    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1,
          };
        return (
            <div >
                <div className="container">
                <Slider {...settings}>

{photos.map((photo) => (
    <img key ={photo.id} alt = "no Image" src={photo.url} />
))}
</Slider>
                </div>

            </div>
        )
    }
}

export default Home
